import 'bootstrap/dist/css/bootstrap.min.css';
import {Container, Form, Card, Row, Button, Image, Col} from 'react-bootstrap';
const numbers = [1, 2, 3, 4, 5];
const TopLocations = () => {
  return numbers.map((number) => {
    1;
  });
};

export default TopLocations;
